        // Q: The school is planning a field trip. There are 180 students and 60 seats on each school bus. How many buses are needed to take the trip?
        int students = 180;
        int seatsPerBus = 60;
        int busesNeeded = (students + seatsPerBus - 1) / seatsPerBus; // Using ceiling division
        int result = busesNeeded;
        return result;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
